import React, {useState} from "react";
import "./styles/styles.scss";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./components/Pages/Home/Home";
import ConnectForm from "./components/Layout/";

export default function App() {
  const [completedFormState, setCompletedFormState] = useState(true)
  function handleCompletedForm(){
    setCompletedFormState(!completedFormState)
   }

  return (
    <BrowserRouter>
      <ConnectForm/>
      {/* <NavBar 
        completedFormState={completedFormState} 
      /> 
      <CompletedConnectForm
        completedFormState={completedFormState}
        handleCompletedForm={handleCompletedForm}
      /> */}
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/completedForm" element={<Home/>}/>
      </Routes>
    </BrowserRouter>
  );
}
